import React from 'react';

export const Menu = () => {

    return(
        <>
         <NavList>
             <NavLink to="/menu"><li>Menu</li></NavLink> <br />
             <NavLink to="/listar"><li>Listar</li></NavLink> <br />
        </NavList>
            <h1>Menu principal</h1>
        </>
    )
}
